    false,nt"url": null,nt"notes": "This dataset represents the availability
    of wireline broadband Internet access in Rhode Island via "Optical Carrier - Fiber
    to the End User" technology. Broadband availability is summarized at the census
    block level using the US Census Bureau's 2010 decennial census measurement areas.
    These data were compiled by Broadband Rhode Island (http://broadband.ri.gov) in
    support of the National Telecommunications and Infrastructure Administration (NTIA)
    State Broadband Initiative (http://www2.ntia.doc.gov/sbdd). Broadband is considered
    to be available within a census block if a facilities-based provider of broadband
    service currently serves at least one location within the block, or can provide
    broadband services of minimal characteristics to at least one location within the
    block within 7 - 10 business days. For each census block, the provider name and
    the respective technologies they provide are represented. In addition, general categories
    for maximum advertised upload and download speeds are also reported for most provider
    / technology type / census block combinations.",nt"license_title": null,nt"extras":
